import React from 'react';
import './style/About.css';

const About = () => {
  return (
    <div className="container">
      <h2>About QuizApp</h2>
      <p>
        QuizApp is a fun and interactive platform designed to challenge your knowledge on various topics. 
        Whether you're looking to test your skills or learn something new, our quizzes will keep you entertained.
      </p>
      <p>
        We believe learning should be fun and accessible to everyone. Our quizzes range from general knowledge to specialized subjects, ensuring there's something for everyone.
      </p>
      <p>
        Join us, challenge your friends, and let's see how well you can score!
      </p>
    </div>
  );
};

export default About;
